window.bookSummaryJSON = "<p>The holidays are here, and this year, they're deadly . . .</p> <p>It's my first Thanksgiving back in Moonshadow Bay, and everything is hunky-dory until the Witches Guild assigns me a research project for the upcoming Winter Solstice Festival. Not only do I melt down my computer, but I download a demon who ends up stuck in my house.</p> <p>But Tarvish the Funtime demon is the least of my worries when my grandmother asks my BFF and me to go undercover. A magical pyramid scheme has moved into town and it's siphoning more than money off its recruits. Will we be able to take it down, or will the leader of the cult manage to silence us for good?</p>"; 
